        "7447bfce-a3cb-4df4-85a1-ae955a1dd572": "15:30 GMT",
        "031634f9-fb2e-415f-bc6d-6407167c85eb": "@Online",
        "8ec09b36-a206-4bca-ae2d-1c7c7d75b893": "Immerse yourself in a captivating discussion on the latest trends and innovations in graphic design. Explore the evolving landscape of visual communication and discover how graphic designers are reshaping the way we perceive information. Get ready to be inspired and rethink the possibilities of graphic innovation.",
        "d2e256a5-04b8-43a8-badc-556ea2e0e694": "Immerse yourself in a captivating discussion on the latest trends and innovations in graphic design during our \"Graphic Innovation\" event. Visual communication is evolving, and this conference serves as a window into the transformative power of graphic design. Explore the dynamic landscape where graphic designers reshape the way we perceive and interact with information. Led by prominent figures in the field, this event goes beyond the surface, offering a deep dive into the creative processes that fuel graphic innovation. Join us online for an inspiring session that transcends traditional design boundaries. Meet the visionaries: Sarah Mitchell, Creative Director at Visionary Designs, Kevin Foster, Visual Storyteller & Illustrator, and Dr. Rachel Nguyen, Graphic Design Researcher. Get ready to be captivated, inspired, and challenged to rethink the possibilities of graphic innovation. This is your opportunity to witness the forefront of visual communication's evolution.",
